import React from "react";

const SlideList = ({ children, title, list, renderItem: RenderItem }) => {
  return (
    <>
      {title && <h5>{title}</h5>}
      <div className={"slideList"}>
        <ul className={"listWrap"}>{children}</ul>
      </div>
    </>
  );
};

export default SlideList;
